import React from 'react';
import { NavLink } from 'react-router-dom';
import {Navbar, Nav} from 'react-bootstrap';
import './Header.css';

const Header = () => {
    return (
        <div className='topnav'>
            {/* Logo */}
            <Navbar bg = "dark" expand = "lg">
            <Navbar.Toggle aria-controls = "basic-navbar-nav">
                <Navbar.Brand>
                    <a href="/Home">&#9776;
                    <img src={"/small_logo.png"} style={{width:100, marginTop: -7}} />
                    </a>
                </Navbar.Brand>
            </Navbar.Toggle>
            <Navbar.Collapse id = "basic-navbar-nav">
            <Nav>

            <NavLink className="d-inline p-2 bg-dark text-white" to='/about'>About</NavLink>
            <NavLink className="d-inline p-2 bg-dark text-white" to='/philanthropy'>Philanthropy</NavLink>

            </Nav>
            </Navbar.Collapse>
            </Navbar>   
        </div>
    )
}

